import React, { Component } from "react";
import "./Header.css";
import { Link } from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";
import "./NavLink";

export class Header extends Component {
  render() {
    return (
      <Container fluid className="contain">
        <Row className="rows">
          <Col md={8}>
            <div className="logo">
              {" "}
              9JADIASPORA.
              <div className="anime"></div>
            </div>
          </Col>

          <Col md={4}>
            <div className="navvv">
              <ul>
                <Link className="a" to="/" style={{ textDecoration: "none" }}>
                  <li className="navv">Home</li>
                </Link>
                <Link
                  className="b"
                  to="/Culture.js"
                  style={{ textDecoration: "none" }}
                >
                  <li className="navv">Culture</li>
                </Link>
                <Link
                  className="c"
                  to="/Sales.js"
                  style={{ textDecoration: "none" }}
                >
                  <li className="navv">Sales</li>
                </Link>
                <Link
                  className="d"
                  to="/About.js"
                  style={{ textDecoration: "none" }}
                >
                  <li className="navv">About</li>
                </Link>
                <Link
                  className="d"
                  to="/Contact.js"
                  style={{ textDecoration: "none" }}
                >
                  <li className="navv">Contact</li>
                </Link>
              </ul>
            </div>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default Header;
